, almost all of which have come against teams with high-octane passing attacks. Next week's opponent, the Atlanta Falcons, would fall into the latter category, which bodes well for Carr's fantasy outlook in Week 12.\",\"title\":\"Steps it up on SNF\"},{\"timeEpochMilli\":\"1606151045000\",\"contents\":\"BALLER MOVE: Add in 14+ Team LeaguesROSTERED: 36% of LeaguesANALYSIS: It wouldn't be smart trying to sell Carr for what he's not: a weekly fantasy winner. Although Carr's start to the season was impressive, with five straight 15+ FP performances in the span going from Week 2 to Week 7, he later proceeded to finish with paltry 11.6, 14.0, and a season-low 7.2 scores in his next three games. His fantasy GMs must be very pleased with his bounceback this past Sunday against KC, as Carr came back to ...\",\"url\":\"https://www.rotoballer.com/derek-carr-qb-lv-week-12-waiver-wire-pickups/807065\",\"title\":\"Derek Carr (QB, LV) - Week 12 Waiver Wire Pickups\"}],\"nameFirst\":\"Derek\",\"nameLast\":\"Carr\",\"proTeam\":{\"abbreviation\":\"LV\",\"location\":\"Las Vegas\",\"name\":\"Raiders\"},\"externalIds\":[{\"id\":\"9f026fc0-4449-4dc5-a226-2e2830619381\"}],\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6310,\"away\":{\"abbreviation\":\"KC\",\"location\":\"Kansas City\",\"name\":\"Chiefs\"},\"home\":{\"abbreviation\":\"LV\",\"location\":\"Las Vegas\",\"name\":\"Raiders\"},\"startTimeEpochMilli\":\"1606094400000\",\"status\":\"FINAL_SCORE\",\"awayScore\":35,\"homeScore\":31,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"LOSE\",\"awayResult\":\"WIN\"},\"stats\":[{\"category\":{\"id\":12,\"abbreviation\":\"%\",\"nameSingular\":\"Completion Percentage\",\"namePlural\":\"Completion Percentage\"},\"value\":{\"value\":74.19355,\"formatted\":\"23/31\"}},{\"category\":{\"id\":3,\"abbreviation\":\"Yd\",\"nameSingular\":\"Passing Yard\",\"namePlural\":\"Passing Yards\"},\"value\":{\"value\":275.0,\"formatted\"