nameFull\":\"Patrick Mahomes\",\"nameShort\":\"P. Mahomes\",\"proTeamAbbreviation\":\"KC\",\"position\":\"QB\",\"headshotUrl\":\"https://d26bvpybnxg29h.cloudfront.net/nfl/12894.png\",\"nflByeWeek\":10,\"news\":[{\"timeEpochMilli\":\"1606111076000\",\"contents\":\"Mahomes completed 34 of 45 pass attempts for 348 yards, two touchdowns and an interception in Sunday's 35-31 win over the Raiders. He contributed 16 more yards on four rushing attempts.\",\"analysis\":\"Mahomes stat line would suggest that he was able to carve up the Raiders' secondary with ease -- as he does to many defenses around the league -- but the Chiefs' phenom was consistently evading pressure from Oakland's front. The 25-year-old's supernatural ability to throw the ball across his body with an off-balanced stance to avoid would-be tacklers was put on display on a multitude of occasions, almost always resulting in the ball hitting his receiver in the hands for big chunk gains. The only noticeable blemish was a red-zone interception that was likely the result of Demarcus Robinson breaking in the wrong direction on what should have been an out pattern. Mahomes capped off another clutch victory with a two-minute drill to put his squad up for good against a formidable Oakland team. The stellar outing put the signal caller above the 3,000-yard mark for the year. Next up for Mahomes and the Chiefs is a showdown between potential MVP candidates when they travel to Tampa Bay to face Tom Brady and the Buccaneers on Sunday.\",\"title\":\"Unstoppable in comeback victory\"},{\"timeEpochMilli\":\"1606152811000\",\"contents\":\"The Raiders defense had a tough time against the Chiefs explosive offense, allowing 35 points in the loss. They allowed 460 yards of offense, and they also struggled to get off the field on 3rd and 4th down. They have now allowed 30 points or more in half of their games and also struggle to force turnovers and get sacks. They picked off Patrick Mahomes in the red zone late in the first half, but that was about the only bright spot for this defense. They take on a streaky Falcons offense next ...\",\"url\":\"https://www.rotoballer.com/player-news/raiders-defense-allows-35-points/807161\",\"title\":\"Raiders Defense Allows 35 Points\"}],\"nameFirst\":\"Patrick\",\"nameLast\":\"Mahomes\",\"proTeam\":{\"abbreviation\":\"KC\",\"location\":\"Kansas City\",\"name\":\"Chiefs\"},\"externalIds\":[{\"id\":\"11cad59d-90dd-449c-a839-dddaba4fe16c\"}],\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6310,\"away\":{\"abbreviation\":\"KC\",\"location\":\"Kansas City\",\"name\":\"Chiefs\"},\"home\":{\"abbreviation\":\"LV\",\"location\":\"Las Vegas\",\"name\":\"Raiders\"},\"startTimeEpochMilli\":\"1606094400000\",\"status\":\"FINAL_SCORE\",\"awayScore\":35,\"homeScore\":31,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"LOSE\",\"awayResult\":\"WIN\"},\"stats\":[{\"category\":{\"id\":12,\"abbreviation\":\"%\",\"nameSingular\":\"Completion Percentage\",\"namePlural\":\"Completion Percentage\"},\"value\":{\"value\":75.55556,\"formatted\":\"34/45\"}},{\"category\":{\"id\":3,\"abbreviation\":\"Yd\",\"nameSingular\":\"Passing Yard\",\"namePlural\":\"Passing Yards\"},\"value\":{\"value\":348.0,\"formatted\":\"348\"}},{\"category\":{\"id\":5,\"abbreviation\":\"TD\",\"nameSingular\":\"Passing TD\",\"namePlural\":\"Passing TDs\"},\"value\":{\"value\":2.0,\"formatted\":\"2\"}},{\"category\":{\"id\":7,\"abbreviation\":\"INT\",\"nameSingular\":\"Interception\",\"namePlural\":\"Interceptions\",\"lowerIsBetter\":true},\"value\":{\"value\":1.0,\"formatted\":\"1\"}}],\"statsProjected\":[{\"category\":{\"id\":12,\"abbreviation\":\"%\",\"nameSingular\":\"Completion Percentage\",\"namePlural\":\"Completion Percentage\"},\"value\":{\"value\":65.789474,\"formatted\":\"25/38\"}},{\"category\":{\"id\":3,\"abbreviation\":\"Yd\",\"nameSingular\":\"Passing Yard\",\"namePlural\":\"Passing Yards\"},\"value\":{\"value\":307.4