 Allen was held in check a bit in his previous outing, and his rapport with Justin Herbert seems to be growing despite some inconsistency over the last few weeks. He will look to build on this effort next Sunday against a Bills defense that has been surprisingly susceptible to opposing wideouts this season.\",\"title\":\"Makes 16 catches in monster game\"},{\"timeEpochMilli\":\"1606090999000\",\"contents\":\"Los Angeles Chargers wide receiver Keenan Allen put together a career day in Week 11 versus the New York Jets. Allen was targeted 19 times on Sunday and caught 16 balls for 145 yards and a touchdown. Allen's 16 catches is a new franchise record for most receptions in a game in Chargers history. The wide receiver has been heavily targeted all season long and remains a WR1 in all formats. Allen will draw a favorable matchup against a poor Buffalo Bills secondary in Week 12.\",\"url\":\"https://www.rotoballer.com/player-news/keenan-allen-has-a-career-day-in-week-11/806877\",\"title\":\"Keenan Allen Has A Career Day In Week 11\"}],\"nameFirst\":\"Keenan\",\"nameLast\":\"Allen\",\"proTeam\":{\"abbreviation\":\"LAC\",\"location\":\"Los Angeles\",\"name\":\"Chargers\"},\"externalIds\":[{\"id\":\"5f424505-f29f-433c-b3f2-1a143a04a010\"}],\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6414,\"away\":{\"abbreviation\":\"NYJ\",\"location\":\"New York\",\"name\":\"Jets\"},\"home\":{\"abbreviation\":\"LAC\",\"location\":\"Los Angeles\",\"name\":\"Chargers\"},\"startTimeEpochMilli\":\"1606079100000\",\"status\":\"FINAL_SCORE\",\"awayScore\":28,\"homeScore\":34,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"},\"value\":{\"value\":84.210526,\"formatted\":\"16/19\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Y