leted 22 of 32 passes for 203 yards and three touchdowns with an interception in Sunday's 31-28 win over the Vikings.\",\"analysis\":\"All three TD passes went for six yards or less, as the Dallas offense rode Ezekiel Elliott and the running game between the 20s before Dalton finished the job in the red zone. It was an impressive return to action for the veteran QB, who'd missed the last two games due to a concussion and a COVID-19 diagnosis, and Dalton will get a chance for some revenge against the defense that knocked him out of action in Week 7 when Dallas faces Washington on Thanksgiving in an unlikely battle for the NFC East lead.\",\"title\":\"Tosses three TDs in win\"},{\"timeEpochMilli\":\"1606091567000\",\"contents\":\"Dallas Cowboys quarterback Andy Dalton returned to the field in Week 11 and led the Cowboys to their first win since Week 5. Dalton completed 22 of his 32 pass attempts for 203 yards, three touchdowns, and one interception. He \\\"ran\\\" three times for a total of five yards. Dalton made the Cowboys offense look like an actual NFL offense for the first time in a while. There was some surprise that Garrett Gilbert didn't get a second chance after a decent start last week, but Dalton showed that he ...\",\"url\":\"https://www.rotoballer.com/player-news/andy-dalton-leads-the-cowboys-to-a-week-11-win/806883\",\"title\":\"Andy Dalton Leads The Cowboys To A Week 11 Win\"}],\"nameFirst\":\"Andy\",\"nameLast\":\"Dalton\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"DAL\",\"location\":\"Dallas\",\"name\":\"Cowboys\"},\"externalIds\":[{\"id\":\"d2a0e5af-3850-4f16-8e40-a0b1d15c2ce1\"}],\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6309,\"away\":{\"abbreviation\":\"DAL\",\"location\":\"Dallas\",\"name\":\"Cowboys\"},\"home\":{\"abbreviation\":\"MIN\",\"location\":\"Minnesota\",\"name\":\"Vikings\"},\"startTimeEpochMilli\":\"1606080300000\",\"status\":\"FINAL_SCORE\",\"awayScore\":31,\"homeScore\":28,\"period