 with his 284 total yards and two scores. His positional eligibility will be revisited after the Week 11 slate, but he offers tremendous upside with his rushing acumen heading into a Week 12 matchup against the Broncos.\",\"title\":\"Effective in starting QB debut\"},{\"timeEpochMilli\":\"1606086648000\",\"contents\":\"New Orleans Saints quarterback Taysom Hill completed 18 of 23 passes for 233 passing yards and carried the ball 10 times for 51 rushing yards and two scores. Hill showed off some serious arm strength, connecting on multiple plays of 20 yards or more, including a 44-yard pass to Emmanuel Sanders. Hill had a touchdown pass negated by a penalty and also fumbled the ball, his third one this year. Other than that, the jack-of-all-trades looked pretty darn good as the starting signal-caller. He'll ...\",\"url\":\"https://www.rotoballer.com/player-news/taysom-hill-rushes-for-two-touchdowns-in-victory/806849\",\"title\":\"Taysom Hill Rushes For Two Touchdowns In Victory\"}],\"nameFirst\":\"Taysom\",\"nameLast\":\"Hill\",\"proTeam\":{\"abbreviation\":\"NO\",\"location\":\"New Orleans\",\"name\":\"Saints\"},\"externalIds\":[{\"id\":\"3c8a55dd-20a8-4375-b711-49eb5e6e1d0e\"}],\"positionEligibility\":[\"QB\",\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6304,\"away\":{\"abbreviation\":\"ATL\",\"location\":\"Atlanta\",\"name\":\"Falcons\"},\"home\":{\"abbreviation\":\"NO\",\"location\":\"New Orleans\",\"name\":\"Saints\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"awayScore\":9,\"homeScore\":24,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":12,\"abbreviation\":\"%\",\"nameSingular\":\"Completion Percentage\",\"namePlural\":\"Completion Percentage\"},\"value\":{\"value\":78.26087,\"formatted\":\"18/23\"}},{\"category\":{\"id\":3,\"abbreviation\":\"Yd\",\"nameSingular\":\"Passing Yard\",\"namePlural\":\"Passing Yards\"},\"val