tal\":{\"value\":346.4,\"formatted\":\"346.4\"},\"seasonAverage\":{\"value\":38.488888,\"formatted\":\"38.49\"},\"seasonsStandartDeviation\":{\"value\":6.2403345,\"formatted\":\"6.24\"},\"seasonConsistency\":\"RATING_VERY_GOOD\"},{\"proPlayer\":{\"id\":9360,\"nameFull\":\"Travis Kelce\",\"nameShort\":\"T. Kelce\",\"proTeamAbbreviation\":\"KC\",\"position\":\"TE\",\"headshotUrl\":\"https://d26bvpybnxg29h.cloudfront.net/nfl/9360.png\",\"nflByeWeek\":10,\"news\":[{\"timeEpochMilli\":\"1606113573000\",\"contents\":\"Kelce hauled in eight passes (10 targets ) for 127 yards and a touchdown Sunday. He also completed his lone pass attempt on a trick play for four yards in a 35-31 win over Oakland.\",\"analysis\":\"Kelce feasted between the hashes against the Raiders' safeties, consistently getting open down the field as Patrick Mahomes scrambled to buy time behind the line before connecting with his favorite target. The 31-year-old has been on an absolute tear of late, averaging 9.3 receptions and 139.7 yards with two total touchdowns over his last three contests. With George Kittle (foot) missing the majority of the season, Kelce has reclaimed his spot alone atop the fantasy tight-end summit. Next week's opponent, the Tampa Bay Buccaneers, boasts a pair of athletic coverage linebackers patrolling the middle of the field, but Kelce is a must-start player regardless of matchup.\",\"title\":\"Catches game-winning score\"},{\"timeEpochMilli\":\"1606106800000\",\"contents\":\"Kansas City Chiefs tight end Travis Kelce caught 8 passes for 127 yards and one touchdown versus the Las Vegas Raiders in Week 11. Kelce's touchdown was a 22-yard catch that turned out to be the game winning score Kansas City. Kelce has now topped 100yards in three consecutive games and has two touchdowns over that span. Kelce will face a tough Tampa Bay Buccaneers Defense in Week 12, but he has proven he is a different breed and is in a class of his own when it comes to the tight end ...\",\"url\":\"https