\",\"title\":\"Scores long TD in loss\"},{\"timeEpochMilli\":\"1606099411000\",\"contents\":\"New England Patriots wide receiver Damiere Byrd put together his best game of the season versus the Houston Texans in Week 11. He hauled in six of his seven targets for 132 yards and one touchdown in the loss. Those 132 yards set a career high for Byrd who has not gone over 100 yards all season until now. Fantasy owners should not get too excited about this performance. Byrd is worth adding in deep leagues, but he still doesn't produce anything more than low flex value most weeks.\",\"url\":\"https://www.rotoballer.com/player-news/damiere-byrd-sets-career-high-in-receiving-yards/806969\",\"title\":\"Damiere Byrd Sets Career High In Receiving Yards\"}],\"nameFirst\":\"Damiere\",\"nameLast\":\"Byrd\",\"proTeam\":{\"abbreviation\":\"NE\",\"location\":\"New England\",\"name\":\"Patriots\"},\"externalIds\":[{\"id\":\"48d7bc31-808f-423c-afc8-45c2c5dfa45f\"}],\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6300,\"away\":{\"abbreviation\":\"NE\",\"location\":\"New England\",\"name\":\"Patriots\"},\"home\":{\"abbreviation\":\"HOU\",\"location\":\"Houston\",\"name\":\"Texans\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"awayScore\":20,\"homeScore\":27,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"},\"value\":{\"value\":85.71429,\"formatted\":\"6/7\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"},\"value\":{\"value\":132.0,\"formatted\":\"132\"}},{\"category\":{\"id\":26,\"abbreviation\":\"Fum\",\"nameSingular\":\"Fumble\",\"namePlural\":\"Fumbles\",\"lowerIsBetter\":true},\"value\":{\"formatted\":\"0\"}},{\"category\":{\"id\":29,\"abbreviation\":