k carried the ball 27 times for 115 yards and a touchdown and caught all five of his targets for 45 yards in Sunday's 31-28 loss to the Cowboys.\",\"analysis\":\"His incredible run of production continues. Since the Vikings' Week 7 bye, Cook has amassed 750 combined yards and seven total TDs in four games, and he's topped 100 scrimmage yards in six of his last seven starts. Derrick Henry nudged ahead of him Sunday in the race for the league rushing title, but Cook will look to reclaim the lead in Week 12's tilt against the Panthers.\",\"title\":\"Doesn't slow down against Dallas\"},{\"timeEpochMilli\":\"1606093187000\",\"contents\":\"Minnesota Vikings running back Dalvin Cook carried the ball 27 times for 115 yards, 45 receiving yards and one touchdown in the Vikings 31-28 loss to the Cowboys in Week 11. Cook continues to be the premier workhorse in the NFL and now has 20+ carries in six of his last seven games. Cook punched in a touchdown in the first half for his 13th rushing touchdown of the season and posted his fifth 100+-yard rushing game of the season. The elite back will continue to be a top choice in all fantasy ...\",\"url\":\"https://www.rotoballer.com/player-news/dalvin-cook-totals-160-yards-one-touchdown/806908\",\"title\":\"Dalvin Cook Totals 160 Yards, One Touchdown\"}],\"nameFirst\":\"Dalvin\",\"nameLast\":\"Cook\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"MIN\",\"location\":\"Minnesota\",\"name\":\"Vikings\"},\"externalIds\":[{\"id\":\"8960d61e-433b-41ea-a7ad-4e76be87b582\"}],\"positionEligibility\":[\"RB\"]},\"requestedGames\":[{\"game\":{\"id\":6309,\"away\":{\"abbreviation\":\"DAL\",\"location\":\"Dallas\",\"name\":\"Cowboys\"},\"home\":{\"abbreviation\":\"MIN\",\"location\":\"Minnesota\",\"name\":\"Vikings\"},\"startTimeEpochMilli\":\"1606080300000\",\"status\":\"FINAL_SCORE\",\"awayScore\":31,\"homeScore\":28,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"LOSE\",\"awayRes