same player he used to be, but with a couple of juicy matchups on tap, you should think of him as a high-end QB2 with QB1 upside for the next two weeks.\",\"url\":\"https://www.rotoballer.com/player-news/cam-newton-tosses-over-300-yards-in-week-11/806941\",\"title\":\"Cam Newton Tosses Over 300 Yards In Week 11\"}],\"nameFirst\":\"Cam\",\"nameLast\":\"Newton\",\"proTeam\":{\"abbreviation\":\"NE\",\"location\":\"New England\",\"name\":\"Patriots\"},\"externalIds\":[{\"id\":\"214e55e4-a089-412d-9598-a16495df0d25\"}],\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6300,\"away\":{\"abbreviation\":\"NE\",\"location\":\"New England\",\"name\":\"Patriots\"},\"home\":{\"abbreviation\":\"HOU\",\"location\":\"Houston\",\"name\":\"Texans\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"awayScore\":20,\"homeScore\":27,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":12,\"abbreviation\":\"%\",\"nameSingular\":\"Completion Percentage\",\"namePlural\":\"Completion Percentage\"},\"value\":{\"value\":65.0,\"formatted\":\"26/40\"}},{\"category\":{\"id\":3,\"abbreviation\":\"Yd\",\"nameSingular\":\"Passing Yard\",\"namePlural\":\"Passing Yards\"},\"value\":{\"value\":365.0,\"formatted\":\"365\"}},{\"category\":{\"id\":5,\"abbreviation\":\"TD\",\"nameSingular\":\"Passing TD\",\"namePlural\":\"Passing TDs\"},\"value\":{\"value\":1.0,\"formatted\":\"1\"}},{\"category\":{\"id\":7,\"abbreviation\":\"INT\",\"nameSingular\":\"Interception\",\"namePlural\":\"Interceptions\",\"lowerIsBetter\":true},\"value\":{\"formatted\":\"0\"}}],\"statsProjected\":[{\"category\":{\"id\":12,\"abbreviation\":\"%\",\"nameSingular\":\"Completion Percentage\",\"namePlural\":\"Completion Percentage\"},\"value\":{\"value\":64.28571,\"formatted\":\"18/28\"}},{\"category\":{\"id\":3,\"abbreviation\":\"Yd\",\"nameSingular\":\"Passing Yard\",\"namePlural\":\"