 Hill on shorter routes. Look for Kansas City's dynamic duo to potentially return to the long ball against a Buccaneers defense that loves to blitz the opposition relentlessly and leave its defensive backs in man coverage.\",\"title\":\"Explodes for 11 catches\"},{\"timeEpochMilli\":\"1606107704000\",\"contents\":\"Kansas City Chiefs wide receiver Tyreek Hill extended his touchdown streak to four in Week 11 versus the Las Vegas Raiders and has now scored in 9 of 10 games this season. Hill also caught 11 of his 14 targets for 102 yards. Hill continues to operate with tight end Travis Kelce as the top options in an explosive Chiefs offense. Hill will face a tough Tampa Bay Buccaneers Defense in Week 12, but is too talented to not be viewed as a WR1 on a weekly basis.\",\"url\":\"https://www.rotoballer.com/player-news/tyreek-hill-extends-touchdown-streak/807023\",\"title\":\"Tyreek Hill Extends Touchdown Streak\"}],\"nameFirst\":\"Tyreek\",\"nameLast\":\"Hill\",\"proTeam\":{\"abbreviation\":\"KC\",\"location\":\"Kansas City\",\"name\":\"Chiefs\"},\"externalIds\":[{\"id\":\"01d8aee3-e1c4-4988-970a-8c0c2d08bd83\"}],\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6310,\"away\":{\"abbreviation\":\"KC\",\"location\":\"Kansas City\",\"name\":\"Chiefs\"},\"home\":{\"abbreviation\":\"LV\",\"location\":\"Las Vegas\",\"name\":\"Raiders\"},\"startTimeEpochMilli\":\"1606094400000\",\"status\":\"FINAL_SCORE\",\"awayScore\":35,\"homeScore\":31,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"LOSE\",\"awayResult\":\"WIN\"},\"stats\":[{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"},\"value\":{\"value\":78.57143,\"formatted\":\"11/14\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"},\"value\":{\"value\":102.0,\"formatted\":\"102\"}},{\"category\":{\"id\":26,\"abbrev