0\",\"contents\":\"Baltimore Ravens quarterback Lamar Jackson went 17-for-29 for 186 yards, a touchdown, and an interception during the overtime loss to the Titans on Sunday. He also added 51 yards off 13 carries. The 23-year-old struggled with his accuracy once again in Week 11, producing his second outing with less than 60 percent passing in his previous four games. Although he still ranks as one of the best fantasy quarterbacks in the league, he will have an uphill battle in Week 12 against the efficient ...\",\"url\":\"https://www.rotoballer.com/player-news/lamar-jackson-cant-lead-ravens-to-a-win/806884\",\"title\":\"Lamar Jackson Can't Lead Ravens To A Win\"}],\"nameFirst\":\"Lamar\",\"nameLast\":\"Jackson\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"BAL\",\"location\":\"Baltimore\",\"name\":\"Ravens\"},\"externalIds\":[{\"id\":\"e06a9c07-453a-4bb0-a7e9-2c3a64166dad\"}],\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6301,\"away\":{\"abbreviation\":\"TEN\",\"location\":\"Tennessee\",\"name\":\"Titans\"},\"home\":{\"abbreviation\":\"BAL\",\"location\":\"Baltimore\",\"name\":\"Ravens\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"awayScore\":30,\"homeScore\":24,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"LOSE\",\"awayResult\":\"WIN\"},\"stats\":[{\"category\":{\"id\":12,\"abbreviation\":\"%\",\"nameSingular\":\"Completion Percentage\",\"namePlural\":\"Completion Percentage\"},\"value\":{\"value\":58.62069,\"formatted\":\"17/29\"}},{\"category\":{\"id\":3,\"abbreviation\":\"Yd\",\"nameSingular\":\"Passing Yard\",\"namePlural\":\"Passing Yards\"},\"value\":{\"value\":186.0,\"formatted\":\"186\"}},{\"category\":{\"id\":5,\"abbreviation\":\"TD\",\"nameSingular\":\"Passing TD\",\"namePlural\":\"Passing TDs\"},\"value\":{\"value\":1.0,\"formatted\":\"1\"}},{\"category\":{\"id\":7,\"abbreviation\":\"INT\",\"nameSingular\":\"Interception\",\"name