 yards and a touchdown in Week 11 against the Colts.\",\"analysis\":\"Adams didn't rack up his usual double-digit targets, but did make the most of his opportunity in all areas of the field. He found the end zone for his 10th touchdown of the campaign on a five-yard reception midway through the second quarter. While Marquez Valdes-Scantling maintained his role as the primary deep threat, Adams did also manage to log field-stretching receptions of 33, 20, 18 and 14 yards. Adams will face a stiff test in Week 12 against the Bears, though his target volume should help him overcome the poor matchup.\",\"title\":\"Another efficient performance\"},{\"timeEpochMilli\":\"1606094153000\",\"contents\":\"Green Bay Packers wide receiver Davante Adams caught seven passes for 106 yards and one touchdown in the Packers 34-31 overtime loss to the Colts in Week 11. Water is wet and Adams catches touchdowns as the star receiver now has a score in each of his last five games. During that span, Adams has 45 receptions for 594 yards and eight touchdowns. The elite receiver will have, however, a tough tilt next week against a talented Bears Defense.\",\"url\":\"https://www.rotoballer.com/player-news/davante-adams-extends-touchdown-streak-against-colts/806918\",\"title\":\"Davante Adams Extends Touchdown Streak Against Colts\"}],\"nameFirst\":\"Davante\",\"nameLast\":\"Adams\",\"proTeam\":{\"abbreviation\":\"GB\",\"location\":\"Green Bay\",\"name\":\"Packers\"},\"externalIds\":[{\"id\":\"e7d6ae25-bf15-4660-8b37-c37716551de3\"}],\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6305,\"away\":{\"abbreviation\":\"GB\",\"location\":\"Green Bay\",\"name\":\"Packers\"},\"home\":{\"abbreviation\":\"IND\",\"location\":\"Indianapolis\",\"name\":\"Colts\"},\"startTimeEpochMilli\":\"1606080300000\",\"status\":\"FINAL_SCORE\",\"awayScore\":31,\"homeScore\":34,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"